import React from "react";
import { useParams } from "react-router-dom";


const Detail = (props) => {
    console.log(props.sool)
    let urlId = useParams();
    const filteredSool = props.sool.filter((el) => el.id === urlId.id)
    console.log(filteredSool)
    return (
        <div>
            <div>안녕하세요 detail 술 아이디는 {filteredSool.id}</div>
        </div>
    )
}

export default Detail
